            <div className="filters-wrapper">
                <h1 className="page-title">{this.state.title}</h1>

                <div className="filters">
                    <ul>
                        <li className="filter-item">All</li>
                        <li className="filter-item">Furniture</li>
                        <li className="filter-item">Kitchen</li>
                        <li className="filter-item">Lighting</li>
                        <li className="filter-item">Tableware</li>
                    </ul>
                </div>
            </div>
        )
    }
}

export default Filters
